import register from '../register';
import {
    getParams} from '../utils';
import log from './index';
import stringify from '../stringify';


register('utils/onPerformanceFlowEvent', {
    v: 20,
    hasCB: false,
    versionRange: ['7.2'],
    filter: data => {
        return {
            action: 'onPerformanceFlowEvent',
            module: 'utils',
            data: {
                params: stringify(data, true)
            }
        };
    }
});
/**
 * performanceFlowEvent
 * @function disappear
 * @param {object} [data={}] - ubc 参数
 */
export default (data = {}) =>
log(
    getParams('performanceFlowEvent', data)
);
